import React, { Component } from 'react'

class Counter extends Component {

    constructor(props) {
        super(props)

        this.state = {
             count: 0
        }
    }

    render() {
        return (
            <div>
                count - {this.state.count}
            </div>
        )
    }
}

export default Counter
